"""# In code below, chúng ta gửi dụng gợi ý của người dùng (nhưng phim người dùng đang xem và rating) rồi đề xuất nội dụng tương đương"""

CORR_MATRIX = df

def get_similar_movies(movie_name,rating):
  similar_ratings = CORR_MATRIX[movie_name]*(rating-2.5)
  similar_ratings = similar_ratings.sort_values(ascending = False)
  return similar_ratings[:5]
def predict(list_of_movies):
  predictions = []
  for movie, rating in list_of_movies:
    predictions.append(get_similar_movies(movie,rating))
  return predictions

x = [("11'09''01 - September 11",3.665049)]
predict(x)